import React from "react";

import "./Style.css";


function BookCard({ title, author, description, url }) {
  return (
    <div className="repo">
      <p><a target="_blank" rel="noopener noreferrer" href={url}>{title}</a></p>
      <p>por {author}</p>
    </div>
  );
}

export default BookCard;
